import axios from 'axios';

const API_URL = 'http://localhost:8080/api/users';

class UserService {
    loginUser(user) {
        return axios.post(`${API_URL}/login`, user);
    }

    createUser(user) {
        return axios.post(`${API_URL}/create`, user);
    }
}

export default new UserService();
